import { Component, Prop, Vue } from 'vue-property-decorator';
import AppButton from './button.vue';

@Component({
  components: {
    AppButton
  }
})
export default class NoResults extends Vue {
  @Prop() header: string;
  @Prop() icon: string;
  @Prop() btnLabel: string;
  @Prop() body: string;

  buttonClick() {
    this.$emit('button-click');
  }
}
